import React, { Component } from "react";

export default class AssignedSurvey extends Component {

updateFromClick = (location) => this.props.updateCurrentLocation("location")

render () {
return (
    <div className="surveyConfirmation"> 
    <h2>The patient has been assigned the {this.props.surveyName} </h2>
    <button
          className="surveyConfirmButton"
          onClick={() => this.updateFromClick("survey")}
          style={buttonStyle}>
         OK
        </button>
    </div>
    
      );
    }
  }
  
  const buttonStyle = {
    flex: "1"
  };
